        // --- UTILITY FUNCTIONS ---

        /** Renders math elements in a given container. */
        function renderMath(elementId) {
            const container = document.getElementById(elementId);
            if (container && typeof renderMathInElement !== 'undefined') {
                renderMathInElement(container, {
                    delimiters: [
                        { left: "$$", right: "$$", display: true },
                        { left: "$", right: "$", display: false }
                    ]
                });
            }
        }

        /** Shows the end module confirmation modal. */
        window.showEndModuleConfirmation = function() {
            if (window.state.appStage !== 'active') return;

            const modal = document.getElementById('end-module-modal');
            const currentModule = window.state.module;
            document.getElementById('confirm-module-text').textContent =
                `Are you sure you want to end Module ${currentModule}? You will not be able to return to this module.`;
            modal.style.display = "block";
            window.toggleSidebar(false);
        }

        /** Confirms and executes the end module action. */
        window.confirmEndModule = function() {
            document.getElementById('end-module-modal').style.display='none';
            endModule();
        }

        /** Toggles the visibility of the Desmos calculator overlay */
        window.toggleCalculator = function(forceOpen) {
            const calcOverlay = document.getElementById('calculator-overlay');
            const calcButton = document.getElementById('calc-button');

            const isOpen = !calcOverlay.classList.contains('hidden');
            window.state.isCalculatorOpen = forceOpen === undefined ? !isOpen : forceOpen;

            if (window.state.isCalculatorOpen) {
                if (document.getElementById('sidebar').classList.contains('active')) {
                    toggleSidebar(false); // Close sidebar if calculator opens
                }
                calcOverlay.classList.remove('hidden');
                calcButton.classList.remove('bg-blue-500');
                calcButton.classList.add('bg-blue-600', 'ring-2', 'ring-blue-300');
            } else {
                calcOverlay.classList.add('hidden');
                calcButton.classList.remove('bg-blue-600', 'ring-2', 'ring-blue-300');
                calcButton.classList.add('bg-blue-500');
            }
        }

        /** Toggles the sidebar (Question Map/Tools) */
        window.toggleSidebar = function(forceOpen) {
            const sidebar = document.getElementById('sidebar');
            const backdrop = document.getElementById('sidebar-backdrop');

            // Check if we are in a stage that allows sidebar interaction
            if (window.state.appStage !== 'active' && window.state.appStage !== 'review') return;

            const isActive = sidebar.classList.contains('active');
            let shouldOpen = forceOpen === undefined ? !isActive : forceOpen;

            if (shouldOpen) {
                 sidebar.classList.add('active');
                 backdrop.classList.remove('hidden');
                 backdrop.classList.add('backdrop-visible');
                 if (window.state.isCalculatorOpen) {
                    toggleCalculator(false); // Close calculator if sidebar opens
                 }
                 renderQuestionMap(); // Ensure map is up-to-date when opened
            } else {
                 sidebar.classList.remove('active');
                 backdrop.classList.add('hidden');
                 backdrop.classList.remove('backdrop-visible');
            }
        }

        /** Hides all UI elements specific to an active test */
        function hideTestUIElements() {
            if (window.state.timerInterval) clearInterval(window.state.timerInterval);
            document.getElementById('menu-button').classList.add('hidden');
            document.getElementById('test-footer').classList.add('hidden');
            document.getElementById('timer-display').classList.add('hidden');
            document.getElementById('flag-button').classList.add('hidden');
            document.getElementById('student-name-header-display').classList.add('hidden');
            document.getElementById('answer-area').innerHTML = ''; // Ensure answer area is clear
            window.toggleSidebar(false);
            if(window.state.isCalculatorOpen) window.toggleCalculator(false);
        }

        window.initFirebase = function() {
             const authStatus = document.getElementById('auth-status');
             const hiddenUserIdDisplay = document.getElementById('full-user-id-hidden');

             // Wait for auth state
             onAuthStateChanged(auth, async (user) => {
                 if (user) {
                     userId = user.uid;
                     const name = user.email.split('@')[0];

                     // window.state.studentName might be overwritten by loadState, but we ensure it matches user
                     window.state.studentName = name;

                     authStatus.textContent = user.email;
                     hiddenUserIdDisplay.textContent = userId;

                     // Ensure we have the role from Firestore if starting fresh or reloading
                     try {
                         const userDoc = await getDoc(doc(db, "users", userId));
                         if (userDoc.exists()) {
                             const userData = userDoc.data();
                             window.state.role = userData.role;
                             window.state.studentName = userData.displayName || name;
                             window.state.parentEmail = userData.parentEmail;
                             window.state.parentPhone = userData.parentPhone;
                         }
                     } catch (e) {
                         console.warn("Init fetch profile failed", e);
                     }

                     document.getElementById('student-name-display-sidebar').textContent = window.state.studentName;
                     document.getElementById('student-name-header-display').textContent = window.state.studentName;

                     // Attempt to load previous state
                     const stateLoaded = loadState();

                     if (stateLoaded && window.state.studentName !== '') {
                         // Logic to resume based on state
                         if (window.state.appStage === 'teacher_dashboard' || window.state.role === 'teacher') {
                             window.renderTeacherDashboard();
                         } else if (window.state.appStage === 'active') {
                             window.startTest();
                         } else if (window.state.appStage === 'break') {
                             // Break resume logic
                             hideTestUIElements();
                             document.getElementById('timer-display').classList.remove('hidden');
                             window.state.module = 2;

                             const contentDiv = document.getElementById('question-content');
                             contentDiv.innerHTML = `
                                 <div id="break-screen" class="text-center p-12">
                                     <h1 class="text-3xl font-bold text-green-600 mb-4">Module 1 Complete!</h1>
                                     <p class="text-xl">Your performance determined you will now receive the
                                     <span class="font-bold text-indigo-700">${window.state.testHistory.module2.difficulty === 'M2H' ? 'HARD' : 'EASY'}</span> Module 2.</p>
                                     <p class="text-gray-600 mt-4 font-semibold text-lg">5-Minute Break in Progress (Resumed)...</p>
                                     <p id="break-timer-display" class="text-6xl font-mono text-red-600 mt-4">${Math.floor(window.state.timeLeft / 60).toString().padStart(2, '0')}:${(window.state.timeLeft % 60).toString().padStart(2, '0')}</p>
                                     <button onclick="startModuleTwoImmediately()" class="mt-6 px-6 py-3 bg-indigo-500 text-white rounded-xl font-semibold shadow-md hover:bg-indigo-600 transition duration-150 transform hover:scale-105">
                                         Skip Break and Start Module 2
                                     </button>
                                 </div>
                             `;
                             contentDiv.classList.add('flex', 'items-center', 'justify-center');
                             startTimer();
                             renderMath('break-screen');
                         } else if (window.state.appStage === 'finished') {
                             const m1 = window.state.testHistory.module1;
                             const m2 = window.state.testHistory.module2;
                             const totalCorrect = m1.score + m2.score;
                             const finalScorePercentage = (totalCorrect / 44) * 100;
                             renderScoreReport(totalCorrect, finalScorePercentage, 44);
                         } else {
                             window.navigateToHome();
                         }
                     } else {
                         window.navigateToHome();
                     }
                 } else {
                     // No user
                     authStatus.textContent = 'Guest';
                     hiddenUserIdDisplay.textContent = 'Not Auth';
                     renderLoginScreen();
                 }
             });
        }

        window.fetchPastResults = async function() {
            if (!userId) return {};
            try {
                const q = query(collection(db, "results"), where("userId", "==", userId));
                const querySnapshot = await getDocs(q);
                const results = {};
                querySnapshot.forEach((doc) => {
                    const data = doc.data();
                    results[data.testId] = data;
                });
                return results;
            } catch (error) {
                console.error("Error fetching results:", error);
                return {};
            }
        }

        window.saveTestResult = async function() {
            if (!userId) {
                console.error("Cannot save: No user logged in.");
                return;
            }

            const testId = window.state.currentTestId;
            const m1 = window.state.testHistory.module1;
            const m2 = window.state.testHistory.module2;
            const totalCorrect = m1.score + m2.score;
            const percentage = (totalCorrect / 44) * 100;

            const resultData = {
                userId: userId,
                studentName: window.state.studentName,
                parentPhone: window.state.parentPhone,
                testId: testId,
                totalCorrect: totalCorrect,
                percentage: percentage,
                timestamp: Date.now(),
                details: {
                    // Serialize simplified details to save space if needed, but full is fine for Firestore
                    module1Score: m1.score,
                    module2Score: m2.score,
                    module2Difficulty: m2.difficulty
                },
                testHistory: {
                    module1: m1,
                    module2: m2
                },
                answers: {
                    module1: m1.answers,
                    module2: m2.answers
                }
            };

            try {
                const btn = document.getElementById('save-result-btn');
                if(btn) btn.textContent = "Saving...";

                await addDoc(collection(db, "results"), resultData);
                console.log("Result saved successfully.");

                if(btn) {
                    btn.textContent = "Saved!";
                    btn.disabled = true;
                    btn.classList.remove('bg-green-600', 'hover:bg-green-700', 'from-green-500', 'to-green-700');
                    btn.classList.add('bg-gray-500');
                }
            } catch (e) {
                console.error("Error adding document: ", e);
                const btn = document.getElementById('save-result-btn');
                if(btn) btn.textContent = "Save Failed - Retry";
                alert("Failed to save result to the database. Please check your internet connection and try again.");
            }
        }

