        /** Initiates the test sequence */
        window.startTest = function() {
            window.state.appStage = 'active';

            // Show necessary test elements
            document.getElementById('menu-button').classList.remove('hidden');
            document.getElementById('test-footer').classList.remove('hidden');
            document.getElementById('timer-display').classList.remove('hidden');
            document.getElementById('flag-button').classList.remove('hidden');
            document.getElementById('student-name-header-display').classList.remove('hidden');

            renderQuestion();
            renderQuestionMap();
            startTimer();
            saveState(); // Save state after starting test
        }

        // --- REVIEW FUNCTIONS ---

        /** Loads and renders a past attempt of a specific test */
        window.reviewPastAttempt = async function(testId, providedResult) {
             let result = providedResult;
             if (!result) {
                 const results = await window.fetchPastResults();
                 result = results[testId];
             }

             if (!result || !result.answers) {
                 alert("No detailed results found for this test.");
                 return;
             }

             // Set up state
             window.state.currentTestId = testId;
             window.state.appStage = 'review';

             const testData = ALL_TEST_QUESTIONS[testId];
             const m2Key = result.details.module2Difficulty || 'M2E';

             window.state.testHistory = {
                 module1: {
                     questions: testData.M1,
                     answers: result.answers.module1,
                     score: result.details.module1Score,
                     percentage: (result.details.module1Score / 22) * 100
                 },
                 module2: {
                     questions: testData[m2Key],
                     answers: result.answers.module2,
                     score: result.details.module2Score,
                     percentage: (result.details.module2Score / 22) * 100,
                     difficulty: m2Key
                 }
             };

             // Start review mode
             window.startReviewMode();
        }


        // --- REMAINING FUNCTIONS (renderQuestion, renderQuestionMap, etc.) ---


        // Replicating essential functions for file completeness:


        /** Renders the current question and its answer area. */
        function renderQuestion() {
            const { questionIndex, moduleQuestions } = window.state;
            const q = moduleQuestions[questionIndex];
            if (!q) return;

            const isReviewMode = window.state.appStage === 'review';
            const historyKey = window.state.module === 1 ? 'module1' : 'module2';
            const currentModuleHistory = window.state.testHistory[historyKey];

            const userAnswer = isReviewMode ? currentModuleHistory.answers[questionIndex] : window.state.userAnswers[questionIndex];
            const correctAnswer = q.correctAnswer;

            document.getElementById('question-content').classList.remove('flex', 'items-center', 'justify-center');

            // 1. Update Navigation Displays
            document.getElementById('header-test-info').innerHTML = `Math Module <span id="module-display">${window.state.module}</span> | Question <span id="question-number-display">${questionIndex + 1}</span> of 22`;
            document.getElementById('map-module-display').textContent = window.state.module;

            // 2. Render Question Content (KaTeX handles math automatically)
            let imageHtml = '';
            // Check for explicit image URL, used mostly for placeholders now
            if (q.imageUrl && !q.imageUrl.includes('<svg')) {
                 imageHtml = `<img src="${q.imageUrl}" alt="Question Figure" class="my-4 rounded-lg shadow-md max-w-full h-auto border border-gray-300"
                                 onerror="this.onerror=null; this.src='https://placehold.co/400x200/ef4444/ffffff?text=Image+Unavailable+or+Loading+Error'; console.warn('Question image failed to load: ${q.imageUrl}')" />`;
            } else if (q.imageUrl && q.imageUrl.includes('<svg')) {
                 // Insert raw SVG for diagrams
                 imageHtml = `<div class="my-4 mx-auto w-40 h-40 border border-gray-300 rounded-lg shadow-md">${q.imageUrl}</div>`;
            }


            const contentDiv = document.getElementById('question-content');
            contentDiv.innerHTML = `
                <h2 class="text-xl font-semibold mb-4 text-gray-800">${isReviewMode ? 'Review Question' : 'Question'} ${questionIndex + 1}</h2>
                <div id="q-text-container" class="text-lg leading-relaxed text-gray-700">${q.text}</div>
                ${imageHtml}
            `;
            renderMath('q-text-container');

            // 3. Render Answer Area
            const answerArea = document.getElementById('answer-area');
            answerArea.innerHTML = `<h3 class="text-lg font-semibold text-gray-800 mb-4">${isReviewMode ? 'Your Selection & Correct Answer' : 'Your Answer'}:</h3>`;

            if (q.type === 'MC') {
                q.options.forEach((option, i) => {
                    const optionValue = String.fromCharCode(65 + i);
                    let classes = 'bg-white p-4 rounded-lg border border-gray-300 hover:bg-blue-50 transition duration-150 cursor-pointer shadow-sm flex items-center';

                    if (isReviewMode) {
                        if (optionValue === correctAnswer) {
                            classes = 'bg-green-100 border-green-600 ring-2 ring-green-500 shadow-md flex items-center';
                        } else if (optionValue === userAnswer) {
                            classes = 'bg-red-100 border-red-600 ring-2 ring-red-500 shadow-md line-through flex items-center';
                        } else {
                            classes = 'bg-gray-50 border-gray-300 shadow-sm flex items-center';
                        }
                    } else {
                        const isSelected = userAnswer === optionValue;
                        if (isSelected) {
                            classes += ' bg-blue-100 border-blue-600 ring-2 ring-blue-500';
                        }
                    }

                    // Create main option div
                    const optionElement = document.createElement('div');
                    optionElement.className = `answer-option ${classes}`;
                    optionElement.setAttribute('data-value', optionValue);

                    if (!isReviewMode) {
                        // Attach click handler programmatically for reliability outside of innerHTML string
                        optionElement.onclick = function() {
                            selectAnswer(optionValue, this);
                        };
                    }

                    // Option label (A., B., C., D.)
                    const labelSpan = document.createElement('span');
                    labelSpan.className = 'font-medium text-blue-600 mr-3 shrink-0';
                    labelSpan.textContent = `${optionValue}.`;
                    optionElement.appendChild(labelSpan);

                    // Option content area (for math/tables)
                    const contentContainer = document.createElement('span');
                    contentContainer.className = 'option-content flex-grow flex items-center';

                    // Check if option content is HTML (for tables)
                    let isHtmlOption = option.includes('<table') || option.includes('<svg');

                    if (isHtmlOption) {
                        // Insert raw HTML (table/svg)
                        contentContainer.innerHTML = option;
                        // Adjust alignment for tables if present
                        if (option.includes('<table')) {
                            optionElement.classList.remove('items-center');
                            optionElement.classList.add('flex-col', 'items-start', '!p-2');
                            labelSpan.classList.add('mb-2');
                            contentContainer.classList.add('w-full');
                        }
                    } else {
                        // Insert math text for standard options
                        contentContainer.textContent = option;
                    }

                    optionElement.appendChild(contentContainer);
                    answerArea.appendChild(optionElement);

                });
            } else if (q.type === 'SPR') {
                const currentAnswer = isReviewMode ? userAnswer : window.state.userAnswers[questionIndex] || '';

                let feedbackText = '';
                let borderColor = 'border-gray-300';
                let inputDisabled = '';

                if (isReviewMode) {
                    inputDisabled = 'disabled';
                    if (currentAnswer === correctAnswer) {
                        borderColor = 'border-green-600 ring-2 ring-green-500';
                        feedbackText = `<p class="text-green-600 mt-2 font-semibold">Correct Answer: ${correctAnswer}. Your answer was correct.</p>`;
                    } else {
                        borderColor = 'border-red-600 ring-2 ring-red-500';
                        feedbackText = `<p class="text-red-600 mt-2 font-semibold">Your Answer: ${currentAnswer || 'Not Answered'}</p>
                                         <p class="text-green-600 font-semibold">Correct Answer: ${correctAnswer}</p>`;
                    }
                }

                answerArea.innerHTML += `
                    <input id="spr-input" type="text" value="${currentAnswer}" onchange="handleSPRChange(this.value)" ${inputDisabled}
                           placeholder="Enter your answer (e.g., 3.5 or 1/2)"
                           class="w-full p-4 border-2 ${borderColor} rounded-lg focus:ring-blue-500 focus:border-blue-500 text-lg bg-white">
                    ${feedbackText}
                `;
            }

            // 4. Update Flag State
            const isFlagged = window.state.flags[questionIndex];
            const flagButton = document.getElementById('flag-button');
            flagButton.classList.toggle('hidden', isReviewMode);

            if (!isReviewMode) {
                const flagIcon = document.getElementById('flag-icon');
                flagIcon.classList.toggle('text-yellow-500', isFlagged);
                flagIcon.classList.toggle('text-gray-400', !isFlagged);
                flagIcon.setAttribute('fill', isFlagged ? 'currentColor' : 'none');
            }

            // 5. Update Navigation Button States
            document.getElementById('prev-btn').disabled = questionIndex === 0;
            if (isReviewMode) {
                const isLastQuestionOfLastModule = window.state.module === 2 && questionIndex === window.state.moduleQuestions.length - 1;
                document.getElementById('next-btn').textContent = isLastQuestionOfLastModule ? 'End Review' : 'Next Question';
            } else {
                document.getElementById('next-btn').textContent = questionIndex === window.state.moduleQuestions.length - 1 ? 'End Module' : 'Next Question';
            }

            document.getElementById('end-module-button-num').closest('div').classList.toggle('hidden', isReviewMode);

            // Re-render math after updating answer area
            document.querySelectorAll('.option-content').forEach(contentElement => {
                 renderMath(contentElement.id);
            });
            renderMath('answer-area');

            // Save state immediately after rendering a question to capture time, index, and answer changes
            saveState();
        }

        /** Handles MC answer selection */
        window.selectAnswer = function(value, element) {
            if (window.state.appStage !== 'active') return;
            window.state.userAnswers[window.state.questionIndex] = value;
            document.querySelectorAll('.answer-option').forEach(opt => {
                opt.classList.remove('bg-blue-100', 'border-blue-600', 'ring-2', 'ring-blue-500');
            });
            element.classList.add('bg-blue-100', 'border-blue-600', 'ring-2', 'ring-blue-500');
            renderQuestionMap();
            saveState();
        }

        /** Handles Student-Produced Response (SPR) change */
        window.handleSPRChange = function(value) {
            if (window.state.appStage !== 'active') return;
            window.state.userAnswers[window.state.questionIndex] = value;
            renderQuestionMap();
            saveState();
        }

        /** Toggles the "Mark for Review" flag */
        window.toggleFlag = function() {
            if (window.state.appStage !== 'active') return;
            const index = window.state.questionIndex;
            window.state.flags[index] = !window.state.flags[index];
            renderQuestion();
            renderQuestionMap();
            saveState();
        }

        /** Handles question navigation (Next/Previous/Direct Click) */
        window.navigateTo = function(direction) {
            let nextIndex = window.state.questionIndex;

            if (direction === 'next') {
                if (nextIndex < window.state.moduleQuestions.length - 1) {
                    nextIndex++;
                } else if (window.state.appStage === 'review') {
                    if (window.state.module === 1) {
                        window.state.module = 2;
                        window.state.questionIndex = 0;
                        window.state.moduleQuestions = window.state.testHistory.module2.questions;
                        renderQuestion();
                        renderQuestionMap();
                        return;
                    } else {
                        window.state.appStage = 'finished';
                        renderScoreReport(
                            window.state.testHistory.module1.score + window.state.testHistory.module2.score,
                            ((window.state.testHistory.module1.score + window.state.testHistory.module2.score) / 44) * 100,
                            44
                        );
                        return;
                    }
                } else {
                    window.showEndModuleConfirmation(); // Trigger modal instead of ending directly
                    return;
                }
            } else if (direction === 'prev') {
                if (nextIndex > 0) {
                    nextIndex--;
                } else if (window.state.appStage === 'review' && window.state.module === 2) {
                    window.state.module = 1;
                    window.state.questionIndex = 21;
                    window.state.moduleQuestions = window.state.testHistory.module1.questions;
                    renderQuestion();
                    renderQuestionMap();
                    return;
                }
            } else if (typeof direction === 'number') {
                nextIndex = direction;

                if (window.state.appStage === 'review') {
                    const historyKey = window.state.module === 1 ? 'module1' : 'module2';
                    const currentModuleHistory = window.state.testHistory[historyKey];
                    window.state.moduleQuestions = currentModuleHistory.questions;
                }

                window.toggleSidebar(false);
            }
            window.state.questionIndex = nextIndex;
            renderQuestion();
            renderQuestionMap();
            saveState();
        }

        /** Renders the question map sidebar */
        function renderQuestionMap() {
            const grid = document.getElementById('question-map-grid');
            grid.innerHTML = '';

            const isReviewMode = window.state.appStage === 'review';
            const historyKey = window.state.module === 1 ? 'module1' : 'module2';
            const currentModuleHistory = window.state.testHistory[historyKey];

            const questionsToMap = window.state.moduleQuestions;

            questionsToMap.forEach((q, i) => {
                const isCurrent = window.state.questionIndex === i;

                let classes = 'p-2 rounded-lg text-center font-medium transition duration-150 shadow-sm';

                if (isReviewMode && currentModuleHistory.questions.length > 0) {
                    const userAnswer = currentModuleHistory.answers[i];
                    const correctAnswer = q.correctAnswer;
                    const isCorrect = userAnswer !== null && userAnswer === correctAnswer;

                    if (isCurrent) {
                        classes += ' bg-blue-600 text-white ring-2 ring-blue-300';
                    } else if (isCorrect) {
                        classes += ' bg-green-500 text-white hover:bg-green-600';
                    } else if (userAnswer !== null) {
                        classes += ' bg-red-500 text-white hover:bg-red-600';
                    } else {
                        classes += ' bg-gray-400 text-white hover:bg-gray-500';
                    }
                } else {
                    const isAnswered = window.state.userAnswers[i] !== null;
                    const isFlagged = window.state.flags[i];

                    if (isCurrent) {
                        classes += ' bg-blue-600 text-white ring-2 ring-blue-300';
                    } else if (isFlagged) {
                        classes += ' bg-red-500 text-white hover:bg-red-600';
                    } else if (isAnswered) {
                        classes += ' bg-green-500 text-white hover:bg-green-600';
                    } else {
                        classes += ' bg-gray-100 text-gray-700 hover:bg-gray-200';
                    }
                }

                grid.innerHTML += `<button onclick="navigateTo(${i})" class="${classes}">${i + 1}</button>`;
            });
        }

        /** Starts the review mode from the final score screen */
        window.startReviewMode = function() {
            window.state.appStage = 'review';
            window.state.module = 1;
            window.state.questionIndex = 0;

            window.state.moduleQuestions = window.state.testHistory.module1.questions;

            document.getElementById('test-footer').classList.remove('hidden');
            document.getElementById('timer-display').classList.add('hidden');
            document.getElementById('flag-button').classList.add('hidden');

            const studentNameHeaderDisplay = document.getElementById('student-name-header-display');
            if (studentNameHeaderDisplay) {
                studentNameHeaderDisplay.textContent = window.state.studentName;
                studentNameHeaderDisplay.classList.remove('hidden');
            }

            renderQuestion();
            renderQuestionMap();

            document.getElementById('next-btn').textContent = 'Next Question';
            saveState();
        }


        // --- CALCULATOR & REFERENCE SHEET ---

        /** Toggles the visibility of the Reference Sheet Modal */
         window.toggleReferenceSheet = function() {
            const modal = document.getElementById('reference-sheet-modal');
            if (modal.style.display === "block") {
                modal.style.display = "none";
            } else {
                // CORRECTED: Target the specific content div ID
                renderMath('reference-sheet-content');
                modal.style.display = "block";
                window.toggleSidebar(false);
            }
        }

        // --- SCORING & ADAPTIVE LOGIC ---

        /** Starts the countdown timer for the module or the break */
        function startTimer() {
            if (window.state.timerInterval) clearInterval(window.state.timerInterval);

            const timerDisplay = document.getElementById('timer-display');
            const endModuleBtnNum = document.getElementById('end-module-button-num');

            endModuleBtnNum.textContent = window.state.module;

            window.state.timerInterval = setInterval(() => {

                window.state.timeLeft--;
                const minutes = Math.floor(window.state.timeLeft / 60);
                const seconds = window.state.timeLeft % 60;
                const timeString = `${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;

                if (window.state.appStage === 'break') {
                    timerDisplay.textContent = 'Break: ' + timeString;
                    const breakTimerDisplay = document.getElementById('break-timer-display');
                    if (breakTimerDisplay) breakTimerDisplay.textContent = timeString;

                    if (window.state.timeLeft <= 0) {
                        clearInterval(window.state.timerInterval);
                        startModuleTwoImmediately();
                    }
                    saveState();
                    return;
                }

                timerDisplay.textContent = timeString;

                if (window.state.timeLeft <= 0) {
                    endModule();
                }

                if (window.state.timeLeft <= 300 && window.state.timeLeft > 0) {
                     timerDisplay.classList.remove('text-blue-600');
                     timerDisplay.classList.add('text-red-600');
                } else if (window.state.timeLeft > 300) {
                     timerDisplay.classList.add('text-blue-600');
                     timerDisplay.classList.remove('text-red-600');
                }
                saveState();
            }, 1000);
        }

        /** Called at the end of the break to start Module 2 */
        window.startModuleTwoImmediately = function() {
            if (window.state.timerInterval) clearInterval(window.state.timerInterval);

            window.state.appStage = 'active';
            window.state.timeLeft = 33 * 60;

            document.getElementById('timer-display').textContent = '33:00';

            // Show necessary test elements for Module 2 restart
            document.getElementById('test-footer').classList.remove('hidden');
            document.getElementById('flag-button').classList.remove('hidden');
            document.getElementById('menu-button').classList.remove('hidden');
            document.getElementById('student-name-header-display').classList.remove('hidden');

            renderQuestion();
            renderQuestionMap();
            startTimer();
            saveState();
        }

        /** Converts raw correct count (out of 44) to the SAT scale (200-800) */
        function convertRawToScaledScore(rawScore) {
            const minRaw = 0;
            const maxRaw = 44;
            const minScaled = 200;
            const maxScaled = 800;

            // Simple linear scaling: (Score - MinRaw) * (MaxScaled - MinScaled) / (MaxRaw - MinRaw) + MinScaled
            // 44 questions span a range of 600 points (800 - 200).
            // Each correct question is worth approximately 600 / 44 ≈ 13.63 points (with a base of 200).

            if (rawScore <= minRaw) return minScaled;
            if (rawScore >= maxRaw) return maxScaled;

            const scaledScore = Math.round(
                (rawScore - minRaw) * (maxScaled - minScaled) / (maxRaw - minRaw) + minScaled
            );

            // Round to the nearest 10 for a typical SAT score look
            return Math.round(scaledScore / 10) * 10;
        }


